export default function Persons({ persons, filter }) {
  if (filter === '') {
    return (
      <ul>
        {persons.map((e) => (
          <p key={e.name}>
            {e.name} {e.number}
          </p>
        ))}
      </ul>
    );
  }
  return (
    <ul>
      {persons.map((e) => (
        <p key={e.name}>
          {e.name} {e.number}
        </p>
      ))}
